from collections import Counter
import collections

class Solution(object):
    def totalFruit_optimal(self, fruits):
        """
        :type fruits: List[int]
        :rtype: int
        """
        fruits_freq = collections.defaultdict(int)
        maxLen = l = r = 0
        
        while r < len(fruits):
            fruits_freq[fruits[r]] += 1

            while len(fruits_freq) > 2:
                # slide window, move first fruit
                fruits_freq[fruits[l]] -= 1
                if not fruits_freq[fruits[l]]:
                    fruits_freq.pop(fruits[l])
                l += 1
            
            maxLen = max(maxLen, r - l + 1)
            r += 1

        return maxLen
    
    def totalFruit(self, fruits):
        """
        :type fruits: List[int]
        :rtype: int
        """
        fruits_freq = Counter()
        maxLen = l = r = distinct_fruits_in_basket = 0
        max_baskets = 2
        
        while r < len(fruits):
            if fruits_freq[fruits[r]] == 0:
                distinct_fruits_in_basket += 1
                
            fruits_freq[fruits[r]] += 1

            while distinct_fruits_in_basket > max_baskets:
                # slide window, move first fruit
                fruits_freq[fruits[l]] -= 1
                if fruits_freq[fruits[l]] == 0:
                    distinct_fruits_in_basket -= 1
                l += 1
            
            maxLen = max(maxLen, r - l + 1)
            r += 1

        return maxLen
    
    def totalFruit_stupid(self, fruits):
        """
        :type fruits: List[int]
        :rtype: int
        """
        fruits_freq = Counter()
        maxLen = l = r = distinct_fruits_in_basket = 0
        max_baskets = 2
        
        while r < len(fruits):
            if fruits_freq[fruits[r]] == 0:
                distinct_fruits_in_basket += 1
                
            fruits_freq[fruits[r]] += 1

            if distinct_fruits_in_basket > max_baskets:
                # remove latest fruit
                fruits_freq[fruits[r]] -= 1
                distinct_fruits_in_basket -= 1
                r -= 1
                maxLen = max(maxLen, r - l + 1)

                # slide window, move first fruit
                fruits_freq[fruits[l]] -= 1
                if fruits_freq[fruits[l]] == 0:
                    distinct_fruits_in_basket -= 1
                l += 1
            
            r += 1

        maxLen = max(maxLen, r - l + 1)
        return maxLen


